import React from 'react';
import { Routes, Route, Navigate } from "react-router-dom";

// Import Pages
import Signup from "./components/RegisterPage";
import Login from "./components/LoginPage";
import ForgotPassword from "./components/ForgotPassword";
import PasswordReset from "./components/PasswordReset";
import EmailVerify from "./components/EmailVerify";
import MainPage from "./components/MainPage"; 
import GamePage from "./components/GamePage";
import About from "./components/About";
import Wallet from "./components/Wallet";
import Dashboard from "./components/Dashboard";



// Import ErrorBoundary and PrivateRoute
import ErrorBoundary from './components/ErrorBoundary';
import ContactPage from './components/ContactPage';
import PrivacyPolicy from './components/PrivacyPolicy';


function App() {
  const user = localStorage.getItem("token");

  return (
    <Routes>
      {/* Public Routes - No Authentication Required */}
      <Route path="/signup" element={<Signup />} />
      <Route path="/login" element={<Login />} />
      <Route path="/forgot-password" element={<ForgotPassword />} />
      <Route path="/password-reset/:id/:token" element={<PasswordReset />} />
      <Route path="/users/:id/verify/:token" element={<EmailVerify />} />

      {/* Main (Public) Routes */}
      <Route path="/" element={<MainPage />} />
      <Route path="/gamepage" element={<GamePage />} />
      <Route path="/About" element={<About />} />
      <Route path="/contact" element={<ContactPage />} />
      <Route path='/privacypolicy' element={<PrivacyPolicy/>}/>

      {/* Protected Routes - Require Authentication */}
      <Route>
        <Route path="/wallet" element={<ErrorBoundary><Dashboard /></ErrorBoundary>} />
        <Route path="/settings" element={<ErrorBoundary><Settings /></ErrorBoundary>} />
        <Route path="/wallet" component={<ErrorBoundary><Wallet /></ErrorBoundary>} />
        <Route path="/add-funds" component={<ErrorBoundary><AddFunds /></ErrorBoundary>} />
        <Route path="/withdraw-funds" component={<ErrorBoundary><WithdrawFunds /></ErrorBoundary>} />
        <Route path="/transfer-money" component={<ErrorBoundary><TransferMoney /></ErrorBoundary>} />
       
        
      </Route>

      {/* Catch-all Route: Redirect to login if user is not authenticated */}
      <Route path="*" element={<Navigate to={user ? "/" : "/login"} />} />
    </Routes>
  );
}

export default App;
